import { PokerContext } from '../helpers/Contexts';
import '../App.css'

function Turn() {
    const { setGameState } = useContext(PokerContext)
    return (
        <div className='Turn'>
            <h3>Turn Content</h3>
            <button onClick={() => { setGameState("river") }}>next</button>
        </div>
    )
}

export default Turn
